import classes from './MealItem.module.css';



const MealItem = props => {
    console.log(props.meals)
    const meals = props.meals.map(meal => {
        return <li className={classes.meal}><h3>{meal.name}</h3><p className={classes.description}>{meal.description}</p><p className={classes.price}>{meal.price}</p></li>
    })
return(
{meals}
)
}


export default MealItem;
